import logo from '../../assets/images/logo.png';

export const Header = () => {

  return (
    <header >
      <Row>
        <Col span={8}>COL-8</Col>
        <Col span={8}>COL-8</Col>
        <Col span={8}>COL-8</Col>
      </Row>

    </header>
   
  );
};
